import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from '../home/home/home.component';
import { DashboardComponent } from './dashboard/dashboard/dashboard.component';
import { BookListComponent } from './book/book-list/book-list.component';
import { TypeListComponent } from './type/type-list/type-list.component';
import { AuthorListComponent } from './author/author-list/author-list.component';

const routes: Routes = [
  {
    path: '',
    component: DashboardComponent,
    children: [
      { path: '/admin/book/book-list', component: BookListComponent },
      { path: '/admin/type/type-list', component: TypeListComponent },
      { path: '/admin/author/author-list', component: AuthorListComponent },
      { path: '', redirectTo: 'book/book-list', pathMatch: 'full' },
    ],
  },
];


@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class AdminRoutingModule { }
